import React, { useState } from 'react';
const navigation= () =>{
  return (
  <div class="nav-list">
    <ul>
    <li class="h-link">
    <a href="/about">About</a>
    </li>
    <li class="h-link">
    <a href="/projects">Projects</a>
    </li>
    <li class="h-link">
    <a href="/contact">Contact</a>
    </li>
    <li class="h-link">
      <a href="/resume">Resume</a>
    </li>
    </ul>
  </div>
  );
}
export default navigation;
